I’m taking my first step towards teaching after receiving many requests! I’m now offering weekly tips with short videos I will make for my IG subscribers only and it’s very affordable (less than a starbucks 🤪) 
These videos will be technical based (lighting techniques, gear, photo, video, retouching and more)
I’m so excited for this new journey I’m taking on and excited to share my knowledge I learned through Photography school and my own experience. Subscribe now 💙

